    data: |
      SELECT * FROM tab1 (FORMAT parquet) WHERE - col1 * - 33 + - col1 + + col2 + - - col0 * - col1 / + col2 + - col2 + - col0 * + CAST ( - col0 * col1 AS INTEGER ) IS NULL;
  - name: tab1

outputs:
  - name: q1434.out
    data: |
